var outline = false;

function Validate(this1) {
    var res = false;
    var one = true;
    var value = this1.val() != null ? this1.val().trim() : '';
    if (!outline) outline = this1.css("outline");
    if (this1.data('nmforms-validate') == "email") {
        if (value != '') {
            pattern = new RegExp(/^(("[\w-\s]+")|([\w-]+(?:\.[\w-]+)*)|("[\w-\s]+")([\w-]+(?:\.[\w-]+)*))(@((?:[\w-]+\.)*\w[\w-]{0,66})\.([a-z]{2,6}(?:\.[a-z]{2})?)$)|(@\[?((25[0-5]\.|2[0-4][0-9]\.|1[0-9]{2}\.|[0-9]{1,2}\.))((25[0-5]|2[0-4][0-9]|1[0-9]{2}|[0-9]{1,2})\.){2}(25[0-5]|2[0-4][0-9]|1[0-9]{2}|[0-9]{1,2})\]?$)/i);
            if (pattern.test(value)) {
                res = true;
            }
        } else if (!this1.hasClass('required')) {
            res = true;
        }
        one = false;
    } else if (this1.data('nmforms-validate') == "phone" && res == false) {
        if (value != '') {
            pattern = new RegExp(/^[\d\(\)\+\- ]{7,}$/i);
            if (pattern.test(value)) {
                res = true;
            }
        } else if (!this1.hasClass('required')) {
            res = true;
        }
        one = false;
    } else if (this1.data('nmforms-validate') == "url") {
        if (value != '') {
            pattern = new RegExp(/^(https?:\/\/)?([\da-z\.-Ð°-Ñ]+)\.([Ð°-Ña-z\.]{2,6})([\/\w \.-]*)*\/?$/i);
            if (pattern.test(value)) {
                res = true;
            }
        } else if (!this1.hasClass('required')) {
            res = true;
        }
        one = false;
    } else if (this1.data('nmforms-validate') == "file" && res == false) {
        if (value != '') {
            value = value.split('\\').pop();
            format = this1.data('format').split(',');
            format = format.join(")|(");
            pattern = new RegExp('\.((' + format + '))$', 'i');
            if (pattern.test(value)) {
                res = true;
            }
        } else if (!this1.hasClass('required')) {
            res = true;
        }
        one = false;
    }
    if (this1.hasClass('required') && one == true && res == false) {
        if (this1.attr('type') == 'checkbox') {
            if (this1.prop('checked') == true) res = true;
        } else if (value != '') {
            res = true;
        }
        if (res == false) {
            this1.css("border-color", "red");
            var privacy_policy = $('.order_level');
            if (privacy_policy.length > 0) {
                privacy_policy.css("border-bottom", "1px solid red");
            }
        }
    }
    if (res == false) {
        this1.removeClass('valid');
        this1.addClass('invalid');
        this1.next("label").addClass('active');
        if (this1.parents(".nm-material-form").length === 0) {
            var error_text = this1.data("error");
            if (error_text) {
                if (this1.parent(".error_field_wrapper").length < 1) {
                    if (!error_text || error_text == "") {
                        error_text = "Ð—Ð°Ð¿Ð¾Ð»Ð½Ð¸Ñ‚Ðµ ÑÑ‚Ð¾ Ð¿Ð¾Ð»Ðµ";
                    }
                    this1.wrap('<div class="error_field_wrapper"></div>').before('<div class="error_text">' + error_text + '</div>');
                }
            }
        }
    } else {
        this1.removeClass('invalid');
        this1.addClass('valid');
        this1.next("label").addClass('active');
        if (this1.parents(".nm-material-form").length === 0) {
            var error_text = this1.data("error");
            if (error_text) {
                if (this1.parent(".error_field_wrapper").length > 0) {
                    this1.prev(".error_text").remove()
                    this1.unwrap();
                }
            }
        }
    }
    return res;
}

